// Кнопка копирования координат
//==============
	const buttonCoordinate = document.querySelector('#contact_coordinate');
	if (buttonCoordinate) {
		buttonCoordinate.addEventListener("click", function(){
			const coord = this.querySelector('span').innerHTML;
			const copytext = document.createElement('textarea');
			copytext.value = coord ;
			document.body.appendChild(copytext);
			copytext.select();
			document.execCommand('copy');
			document.body.removeChild(copytext);
			this.querySelector('#coordinate-hover').classList.add('disable');
			this.querySelector('#coordinate-copy').classList.add('active');

			setTimeout( () => {
				document.querySelector('#coordinate-hover').classList.remove('disable');
				document.querySelector('#coordinate-copy').classList.remove('active');
			}, 2000);

		});
	}


